import React from "react";
import { Avatar, Card } from "antd";

const UserProfile = () => {
  return (
    <Card actions={[
      <div>hello<br />0</div>
    ]}>
      
      <Card.Meta avatar={<Avatar>Hy</Avatar>} />
    </Card>
  );
};

export default UserProfile;
